INSERT INTO `v1_d40e15c5275060e1556ab0084ff8b84c126706db6a22dcb5d941a60de737c7b8` VALUES (0, 1, 0, "ミヤコ（クリスマス）", 450, 0, "みやこ", 119901, 0, "2023/12/27 11:59:59", 119901, 119901, 1, 0, 1, 2.17, 14, 1, 0, "2023/12/22 12:00:00", "【物理】中衛で、味方をプリンで強化する幽霊聖少女。\n物理攻撃力と物理クリティカルアップのプリンパワーの\nフィールドで自分のスキルも強化し、猛攻を繰り出す。", 119901, 3, 302);
INSERT INTO `v1_d40e15c5275060e1556ab0084ff8b84c126706db6a22dcb5d941a60de737c7b8` VALUES (0, 5, 0, "シズル（ノワール）", 450, 0, "しずる", 120001, 0, "2024/03/28 11:59:59", 120001, 120001, 5, 0, 1, 2.375, 6, 1, 0, "2024/03/22 12:00:00", "【物理】前衛で猛攻から味方を守護する闇のお姉ちゃん。\nバトル開始時の行動不能無効スキルで周囲の味方を守り、\n範囲を束縛するスキルで敵を牽制し、戦況を一変する。", 120001, 3, 190);
